oxy_webhelp_navlinks = {"m365_b_s_groups-d22872e33994":{"topics":[{"title":"Configuration of Microsoft 365 Backup Storage groups","shortdesc":"<p class=\"shortdesc\">To configure Microsoft 365 Backup Storage groups, you must add the Entra ID and         SharePoint groups for Microsoft 365 Backup Storage to <span class=\"ph\">RSC<\/span>. After adding the         groups, you need to assign the SLA Domains to the groups to apply the data protection         policies.<\/p>","href":"m365_backup_storage\/m365_bs_configuration_groups.html","attributes":{"data-id":"m365_bs_configuration_groups"},"menu":{"hasChildren":false},"tocID":"m365_bs_configuration_groups-d22872e34008","next":"m365_bs_configuration_groups-d22872e34008"},{"title":"Maintenance of Microsoft 365 Backup Storage groups","shortdesc":"<p class=\"shortdesc\">Maintaining Entra ID and SharePoint groups for Microsoft 365 Backup Storage involves         regularly reviewing and updating the group details, and removing obsolete group         configurations to ensure optimal performance and resource management.<\/p>","href":"m365_backup_storage\/m365_bs_groups_maintenance.html","attributes":{"data-id":"m365_bs_groups_maintenance"},"menu":{"hasChildren":false},"tocID":"m365_bs_groups_maintenance-d22872e34061","next":"m365_bs_groups_maintenance-d22872e34061"},{"title":"Mass recovery of Microsoft 365 Backup Storage groups","shortdesc":"<p class=\"shortdesc\">Using Microsoft 365 Backup Storage, you can recover one or more groups associated         with Microsoft 365 applications such as SharePoint sites, OneDrive user accounts, or         Exchange mailboxes.<\/p>","href":"m365_backup_storage\/mr_m365_b_s_groups.html","attributes":{"data-id":"mr_m365_b_s_groups"},"menu":{"hasChildren":false},"tocID":"mr_m365_b_s_groups-d22872e34100","next":"mr_m365_b_s_groups-d22872e34100"}]}};